script: |
  super -f text -I q13286.spq | sort > q13286.out

inputs:
  - name: q13286.spq
    data: |
      SELECT ALL - col1 * col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN + - col2 + + - col1 + - col0 AND ( + - col0 );
  - name: tab2

outputs:
  - name: q13286.out
    data: |
      -5025
